// 
window.onload = function() {
  let slide_num = 0;
  // Get all <g> elements
  let slides = [...document.querySelectorAll("g")].sort( (a, b) => {
    if (a.id < b.id) return -1;
    else if (a.id > b.id) return 1;
    else  return 0;
  });
  // Hide all
  if (slides.length > 0) { slides.forEach( s => s.style['display'] = "none" ); }
  // Show first
  slides[slide_num].style['display'] = 'inline';
  // Advance on mousepress
  window.onmousedown = function (ev) {
    slides[slide_num].style['display'] = 'none';
    slide_num = (slide_num + 1) % slides.length;
    slides[slide_num].style['display'] = 'inline';
  };
};
